function elegir_carrera(){
    // limpiar
    cursos_elegidos = [];
    actualizar_cursos_elegidos();
    actualizarCalendario();


    var valor = document.getElementById("listaCarrera").value;
    document.getElementById("nombreCarrera").innerHTML = valor;
    // Cargar datos 
    select = document.getElementById("cursosDisponibles");
    select.innerHTML = "";
    const cursos_carrera = cursos[valor];
    Object.keys(cursos_carrera).forEach((codigo, i) => {
        var opt = document.createElement('option');
        opt.id = codigo;
        opt.value = codigo;
        opt.text = cursos_carrera[codigo]["nombre"];
        select.appendChild(opt);

        //console.log(`${i+1}, ${codigo}, ${cursos_carrera[codigo]["nombre"]}`);
    });
}

// añadir en el calendario

function addCalendar(codCurso, color = 0){
    // revisamos primeramente el nombre de la carrera
    nombre_carrera = document.getElementById('listaCarrera').value;
    const lu = cursos[nombre_carrera][codCurso]["LU"];
    const ma = cursos[nombre_carrera][codCurso]["MA"];
    const mi = cursos[nombre_carrera][codCurso]["MI"];
    const ju = cursos[nombre_carrera][codCurso]["JU"];
    const vi = cursos[nombre_carrera][codCurso]["VI"];
    const sa = cursos[nombre_carrera][codCurso]["SA"];
    const lista = [lu,ma,mi,ju,vi,sa];
    console.log(lu);

    let flag = true;

    let clase = `curso${(color)%10 + 1}`;
    for (let di = 1; di < 7; di++){
        for (let i = 0; i < lista[di-1].length; i++){
            let hora = lista[di-1][i];
            let id = `${hora}${dia(di)}`;
            //console.log(id);
            if (document.getElementById(id).innerHTML != "" && flag){
                alert(`Curso ${codCurso} se sobrepone al curso ${document.getElementById(id).innerHTML}`);
                flag = false;
            }
            document.getElementById(id).innerHTML = codCurso ;
            document.getElementById(id).classList.add(clase);
        }
    }
    
    return 0;
}   

function actualizar_cursos_elegidos(){
    select = document.getElementById('cursosElegidos');
    nombre_carrera = document.getElementById("listaCarrera").value;
    select.innerHTML = ""
    console.log(nombre_carrera);
    const cursos_carrera = cursos[nombre_carrera];
    for (let i = 0; i < cursos_elegidos.length; i++){
        const curso = document.createElement("li");
        //console.log(cursos_carrera);
        curso.innerHTML = `\t<button type="button" style="background: #000; color:#fff; padding: 0px 10px;" onclick="eliminar_curso('${cursos_elegidos[i]}')"><b>X</b></button> \t${cursos_elegidos[i]}\t${cursos_carrera[cursos_elegidos[i]]["nombre"]}`;
        curso.classList.add(`curso${1 + (i%10)}`);
        select.appendChild(curso);
    }
}

function saludar(valor){
    console.log(`'${valor}'`);
}

function eliminar_curso(codigo){
    let valor = -1;
    for (let i = 0; i < cursos_elegidos.length; i++){
        if (cursos_elegidos[i] == codigo){
            valor = i;
            break;
        }
    }
    if (valor != -1){
        cursos_elegidos.splice(valor,1);
        actualizar_cursos_elegidos();
        actualizarCalendario();
    }
}

function actualizarCalendario(){
    // Limpiar la tabla
    for (let i = 7; i < 24; i++){
        for (let di = 1; di < 7; di++){
            document.getElementById(`${i}${dia(di)}`).innerHTML = "";
            document.getElementById(`${i}${dia(di)}`).className = "";
        }
    }

    for (let i = 0; i < cursos_elegidos.length; i++){
        addCalendar(cursos_elegidos[i],i);
    }
}


function elegir_cursos(){
    const valor = document.getElementById("cursosDisponibles").value;
    //console.log(`${valor}`);

    // revisamos si lo tenemos en la lista
    if (cursos_elegidos.indexOf(valor) == -1){
        // no está elegido
        cursos_elegidos.push(valor);
        console.log(cursos_elegidos);
        actualizarCalendario();

        // actualizando la lista
        actualizar_cursos_elegidos();
    }else{
        // si lo eligió
        console.log("Ese curso ya fue elegido");
    }
    
}


